                            </TouchableOpacity>
                        </View>
                    </View>
                    <TouchableOpacity style={styles.nextDeviceBtn} activeOpacity={0.8}>
                        <EntypoIcon name="chevron-right" style={styles.icon} />
                    </TouchableOpacity>
                </View>
            </View>
        </View>
    );
}

